t=0
x=96
y=24


hangerAnimation = {261,263,265,267}
hangern0 = 261
iceAnimation = {336, 339}
characterAnimation = {289, 291, 293, 295}
wardrobeAnimation = {384, 387}
drawerAnimation = {432, 435}

function TIC()

	if btn(0) then y=y-1 end
	if btn(1) then y=y+1 end
	if btn(2) then x=x-1 end
	if btn(3) then x=x+1 end

	

	map(30,18,30,17)

	-- 2 cell animations
	
	spr(spriteReturn(hangerAnimation, 4, 5, hangern0),40,40,7,1,0,0,2,2)
	spr(spriteReturn(characterAnimation, 4, 5, 289),x,y,14,1,0,0,2,2)
	
	
	-- 3 cell animatons
	spr(spriteReturn(wardrobeAnimation, 2, 12, 384),120,90,14,1,0,0,3,3)
	spr(spriteReturn(drawerAnimation, 2, 15, 432),120,120,14,1,0,0,3,2)

	t=t+1
end


function spriteReturn(animation, n, acceleration, n0)

	hangerSpriteNumber = animation[math.ceil((t/acceleration)%n)]

	if(hangerSpriteNumber == nil) then 
		hangerSpriteNumber = n0
	end
	
		

	return hangerSpriteNumber
end

